import {
    SET_APPOINTMENT_FILTER
  } from "../../actions/types";

  const initialState = {
    startDate:'' ,
    endDate: '',
    flag_team_appointments: false
  };

  export default function(state = initialState, action) {
    switch (action.type) {
      case SET_APPOINTMENT_FILTER:
        return {
          startDate: action.payload.startDate,
          endDate: action.payload.endDate
        };
      default:
        return state;
    }
  }
